import BreadCrumb from '../components/BreadCrumb'
import Meta from '../components/Meta'

const Laptops = () => {
  return (
    <>
    <Meta title={"Laptops"}/>
    <BreadCrumb title={"Laptop"}/>
    <div>Laptops</div>
    </>
  )
}

export default Laptops
